import { Container, Header, Section } from './styles';

const Login: React.FC = () => {
  return (
    <Container>
      <Header>
        <img src='/assets/imgs/logo-horizontal.svg' alt='' />
      </Header>
      <Section>
        <div className='top'>
          <img src='/assets/imgs/bga.svg' alt='' />
          <h1 className='title'>Login</h1>
        </div>
      </Section>
    </Container>
  );
};

export default Login;
